#include<stdio.h>
#include<iostream>
#define MAXINT 9999999999;
#include<vector>
using namespace std;

class Solution {
public:
	bool unknown(string str, int i, int j);
	int lengthOfLongestSubstring(string s) {

		int longest = 1, current;
		int length = s.length();
		if (length == 0) {
			printf("This is a  invalid string");
			return 0;
		}
		for (int i = 0; i < length; i++) {
			for (int j = i + 1; j < length; j++) {
				if (unknown(s, i, j)) {
					current = j - i + 1;
					if (longest < current) {
						longest = current;
					}
				}
				else {
					break;
				}
			}

		}
		return longest;
	}
};

bool Solution::unknown(string slice, int i, int j) {
	while (1) {
		if (slice[i] == slice[j]) {
			return false;
		}
		i++;
		if (i == j) {
			break;
		}
	}
	return true;
}


